// App.js
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Content from './path/to/Content';
import ProductDetail from './path/to/ProductDetail';
import CartScreen from './path/to/CartScreen';
import { CartProvider } from './path/to/CartContext';

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <CartProvider>
        <Stack.Navigator initialRouteName="Home">
          <Stack.Screen name="Home" component={Content} />
          <Stack.Screen name="ProductDetail" component={ProductDetail} />
          <Stack.Screen name="Cart" component={CartScreen} />
        </Stack.Navigator>
      </CartProvider>
    </NavigationContainer>
  );
}

export default App;
